import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import NavBar from './components/NavBar/NavBar';
import Home from './components/Home/Home';

function App() {
  return (
    <Router>
        <NavBar />
          <Route exact path='/'>
            <Home />
          </Route>
      </Router>
  );
}

export default App;
